import React from 'react';
import {Col, Row} from 'antd';
import Navbar from '../components/Navbar';


function Combos() {
    return (
        <div className="background">
          <Row>
            <Col xs={24}>
              <Navbar />
            </Col>
          </Row>
          <Row>
            <Col xs={24}>
            </Col>
          </Row>
        </div>
      );
}


export default Combos;
